                        "in questions, to mark an inference or consequence (cf. δή), τὶ δ.; what then? A.Pr.627; τὶ δ. ἐρεῖς, ἤν..; Ar.Nu.1087; τί δ. ἐπειδὰν..; Id.Ach.1011; πῶς δ.; A.Ag.1211, Ar.Nu.79; ἆρ’ οἶσθα δ.; S.OT1014; ἀλλὰ δ...; as the last of several questions, Id.Aj.466, etc.; ποῦ δῆθ’ ὁ τῖμος; A.Ch.916; ποῖ δ. κρανεῖ; ib.1075, etc.; sts. expressing indignation, καὶ δῆτ’ ἐτόλμας; and so thou hast dared? S.Ant.449; ταῦτα δῆτ’ ἀνασχετά; Id.Ph.987; ἦ ταῦτα δῆτ’ ἀνεκτά; Id.OT429; ἔγνωκας οὖν δῆτ’..; Ar.Eq.871; ironical, τῷ σῷ δικαίῳ δ. ἐπισπέσθαι με δεῖ; your principle of justice forsooth, S.El.1037, cf. OT364; in implied questions, esp. after ἀλλά, ἀλλ’ ἡ τέκνων δῆτ’ ὄψις ἦν ἐφίμερος ib.1375, cf. Ar.Av.375, Pl.Hp.Ma.283c; τὴν Εὐρυτείαν οἶσθα δ. παρθένον; of course you know.., S.Tr.121",
