                        "Prep. c. gen., behind, στῆ δ’ ὄπιθεν δίφροιο Il.17.468; ὄπισθε μάχης 13.536; ὄπισθε τῆς θύρης Hdt.1.9; ἔμπροσθέ τε Θερμοπυλέων καὶ ὄ. Id.7.176; ὄ. ἐμοῦ.. εἰσῄει Pl.Smp.175a, etc.: sts. after its case, δίφρου ὄπισθεν Il.24.15; ἴμεν φάμας ὄπισθεν follow the voice, Pi.O.6.63; γνώμης πατρῴας πάντ’ ὄ. ἑστάναι S.Ant.640; also τούτοισι δ’ ὄ. ἴτω Cratin.30; πνοιαῖς ὄπιθεν Βορέα Pi.O.3.31 (s.v.l.). II. of Time, after, in future, hereafter, Il.4.362, Od.2.270, 18.168, etc.; either of a thing absolutely future, or of one which follows something else, opp. αὐτίκα, Il.9.519; ὄπιθεν οὐ πολλόν Pi.O.10(11).35; πολλοῖς μησὶν ὄ. Theoc.Ep.22.8; cf. ὀπίσω II.",
                        "ἐν τοῖσι ὄ. λόγοισι in the books yet to come, in the following books, Hdt.5.22, 7.213; cf. ὀπίσω II.2: but, in Gramm., of what has gone before, Sch.Od.3.366, Hsch. s.v. Ἴωνες, Sch.Ar.Ra.1488; ὁ ὄπιθεν χρόνος the earlier time, PMasp.158.22 (vi A.D.):—for Comp. ὀπίστερος, Sup. ὀπίστατος, v. sub vocc. (Prob. from *ὄπις &#39;back&#39; contained in ἀνόπιν, κατόπιν, μετόπιν, ὀπίσω.) ,"
