                        "Adv., (οὐ, τε) joining neg. clauses, as τε joins posit., but rare in the simple sense and not, Il.22.265 (v.l.), Hdt.3.155 (v.l.); οὔτε γὰρ ἐκείνους διδόναι, Lat. neque enim, Id.1.3 (prob. f.l. for οὐδὲ); and occasionally in later writers, Arist.Ph.208a8, Luc.Par.27,53, etc. II. mostly repeated, οὔτε.., οὔτε.. neither.., nor.., Lat. neque.., neque.., Hom., etc.—Hom. freq. joins another Particle with the first or second οὔτε, as οὔτ’ ἂρ.., οὔτε..; οὔτ’ ἂρ.., οὔτ’ ἂρ..; οὔτ’ ἄρ τε.., οὔτ’ ἄρα.. Il.5.89; οὔτ’ οὖν, v. οὖν I; οὔτε.. οὖν.., οὔτ’ ἄρα.. 20.7; οὔτ’ ἄρ.., οὔτε τι.., or οὔτε τι.., οὔτε.., 1.115, Od.1.202; so too οὔτε.., οὔτε μὴν.. X.Cyr.4.3.12; οὔτε.., οὔτ’ αὖ.., v. infr. ",
