                        "Adv. and Conj., before, until. [πριν 19 times in Hom., Il.2.344, al.; πριν in Il.6.81, 13.172, al.; once written πρείν, Leg.Gort.7.40, but πρίν IG12.60.11, 94.9, 114.46, etc.; Trag. and Com. always πριν (πρίν γ’ must be read in Ar.Ach.176).] A. Adv. of Time, before, either in the sense of sooner or in that of formerly, erst (implying duration up to a certain time): I. of future time, with fut. Indic., πρίν μιν καὶ γῆρας ἔπεισιν Il.1.29, cf. 18.283, Od.2.198, etc.: with Subj. = fut., πρὶν καὶ κακὸν ἄλλο πάθῃσθα Il.24.551: with Opt. and κεν, πρίν κεν ἀνιηθεὶς σὴν πατρίδα γαῖαν ἵκοιο Od.3.117, cf. 11.330, 14.155, Ar.Pax1076, 1112: with Opt., Il.24.800: with Imper., 9.250: with Inf. (expressing a wish), 2.413, (expressing an oath) Od.4.25",
