                        "II. with a finite Verb: ",
                        "with Ind., chiefly aor.: not in Hom. (first in h.Ap.357), who uses Ind. only with πρίν γ’ ὅτε, πρίν γ’ ὅτε δή, after both posit. and neg. clauses, ἠλώμην.., πρίν γ’ ὅτε.. ἤγαγες Od.13.322; πρίν γ’ ὅτε δή με.. κάλεσσεν 23.43, cf. Il.12.437; οὐδέ κεν ἡμέας ἄλλο διέκρινεν.., πρίν γ’ ὅτε δὴ θανάτοιο.. νέφος ἀμφεκάλυψεν Od.4.180: rarely with impf., οὐδ’ ὧς τοῦ θυμὸν.. ἔπειθον, πρίν γ’ ὅτε δὴ θάλαμος πύκ’ ἐβάλλετο (began to be hit) Il.9.588: freq. after Hom., with aor., a. after neg. clauses: of a fact in the past, οὐκ ἦν ἀλέξημ’ οὐδὲν.., πρίν γ’ ἐγώ σφισιν ἔδειξα A.Pr.481; οὐ πρότερον ἀπανέστη.. Μαρδόνιος, πρὶν ἤ σφεας ὑποχειρίους ἐποιήσατο Hdt.6.45; ἀλλ’ οὐδ’ ὣς.. ἠξίωσαν νεώτερόν τι ποιεῖν ἐς αὐτὸν.., πρίν γε δὴ αὐτοῖς.. μηνυτὴς γίγνεται (histor. pres. = aor.) Th.1.132, cf. 3.101, 5.61, Hdt.6.79, Ar.Av.700, X.Cyr.1.4.23,4.5.13 (histor. pres.), HG5.4.58, etc.; once in Pl.,Phdr.266a; as part of an unfulfilled condition, οὐκ ἂν κατέσχε δῆμον οὐδ’ ἐπαύσατο π. ἀνταράξας πῖαρ ἐξεῖλεν γάλα Sol. ap. Arist.Ath.12.5; οὐκ ἂν ἐσκεψάμεθα πρότερον.., πρὶν ἐζητήσαμεν Pl.Men.86d, cf. Tht.165e; χρῆν τοίνυν Λεπτίνην μὴ πρότερον τιθέναι τὸν ἑαυτοῦ νόμον, πρὶν τοῦτον ἔλυσε γραψάμενος D.20.96; after verbs implying a neg., ἀμφιγνοεῖν X.An.2.5.33, θαυμάζειν Th.1.51, λανθάνειν Id.3.29; also with impf., οὔπω ᾔδει.. π. ἐν τῷ κακῷ ἦν Antipho1.19, cf. And.4.17, D.9.6",
