                        "with Subj. only after negs. or equiv. of neg., = ἕως or ἢν μή (in Isoc.4.173 ἢν μή and πρὶν ἄν are used almost as synonyms); οὐ καταδυσόμεθ’, ἀχνύμενοί περ.., πρὶν μόρσιμον ἦμαρ ἐπέλθῃ Od.10.175; μή πω καταδύσεο.., πρίν γ’ ἐμὲ.. ἴδηαι Il.18.135, cf. 190, 24.781; ἀλλ’ ὄμοσον μὴ μητρὶ φίλῃ τάδε μυθήσασθαι, πρίν γ’ ὅτ’ ἂν ἑνδεκάτη τε δυωδεκάτη τε γένηται Od.2.374, cf. 4.477: in Prose usu. πρὶν ἄν (πρίν κα Berl.Sitzb.1927.161 (Cyrene)), rarely π. alone, as also πρὶν ἤ: a. generally with aor., to express an action preceding the action of the anteced. clause, the Verb in which is fut. (or some equiv. of the fut.) or imper., οὐ γαμέεται παρθένος οὐδεμία, πρὶν ἂν τῶν πολεμίων ἄνδρα ἀποκτείνῃ Hdt.4.117, cf. 1.82 (v.l.), 3.109 (v.l.); νῦν δ’ οὐδέν ἐστι τέρμα μοι προκείμενον μόχθων (the sense here is fut.), πρὶν ἂν Ζεὺς ἐκπέσῃ τυραννίδος A.Pr.756, cf. 166 (lyr.), 177 (anap.); οὐ γάρ ποτ’ ἔξει τῆσδε τῆς χώρας, πρὶν ἂν.. στήσῃς ἄγων S.OC909, cf. 48, 1041, OT1529, etc.; οὐκ ἂν ἐκμάθοις.., πρὶν ἂν θάνῃ τις Id.Tr.2; οὐκ ἄπειμι πρὸς δόμους πάλιν, πρὶν ἄν σε.. ἔξω βάλω E.Med.276, cf. 680, Alc.1145, IA324, IT19,1302; μὴ προκαταγίγνωσκε.., π. ἄν γ’ ἀκούσῃς ἀμφοτέρων Ar.V.920, cf. Ach.176, 230, X.Hier.6.13, Cyr.1.2.8, An.",
